        }

        public static NPC Copy(
            INPC item,
            NPC_CopyMask copyMask = null,
            INPCGetter def = null)
        {
            NPC ret;
            if (item.GetType().Equals(typeof(NPC)))
            {
                ret = new NPC();
            }
            else
            {
                ret = (NPC)System.Activator.CreateInstance(item.GetType());
            }
            ret.CopyFieldsFrom(
                item,
                copyMask: copyMask,
                def: def);
            return ret;
        }

        public static NPC Copy_ToLoqui(
            INPCGetter item,
            NPC_CopyMask copyMask = null,
            INPCGetter def = null)
        {
            NPC ret;
            if (item.GetType().Equals(typeof(NPC)))
            {
                ret = new NPC() as NPC;
            }
            else
            {
                ret = (NPC)System.Activator.CreateInstance(item.GetType());
            }
            ret.CopyFieldsFrom(
                item,
                copyMask: copyMask,
                def: def);
            return ret;
        }

